import React, { lazy, Suspense } from "react";
import StopExplanationButton from "./StopExplanationButton";

const ExplanationButtons = () => {
  // websocket connection
  var componentName = "Stocks";
  const DynamicComponent = lazy(() => import(`./${componentName}`));
  return (
    <Suspense fallback={<div>Loading...</div>}>
      <DynamicComponent />
      <StopExplanationButton />
    </Suspense>
  );
};

export default ExplanationButtons;
